import React, {useState} from 'react';
import {Button, Form} from 'react-bootstrap';
import {addWorkout} from '../user/services/user-services';

const AddWorkout = () => {
    const [workout, setWorkout] = React.useState({
        date: "",
        sport: "",
        times: "",
        weight: "",
        person:"Lilly",
        userType:"professional"
      });
      const [date, setDate] = React.useState('');
      const [sport, setSport] = React.useState('');
      const [times, setTimes] = React.useState('');
      const [weight, setWeight] = React.useState('');
      const [person, setPerson] = React.useState('');
      const [userType, setUserType] = React.useState('');

    const sendWorkoutToDB = () => {
        let workoutObject = {
            date : workout.date,
            sport : workout.sport,
            times : workout.times,
            weight : workout.weight,
            person : workout.person,
            userType : workout.userType
        };
        console.log(date);
    }
    return(
        <>
            <Form>
                <h6>Kirjoita treenin tiedot alla oleviin kenttiin</h6>
                <Form.Label>Päivämäärä:</Form.Label>
                <Form.Control onChange={(e) => setDate(e)}/>
                <Form.Label>Laji:</Form.Label>
                <Form.Control onChange={(e) => setSport(e)}/>
                <Form.Label>Suorituskerrat:</Form.Label>
                <Form.Control />
                <Form.Label>Paino:</Form.Label>
                <Form.Control />
                <br />
                <Button onClick = {sendWorkoutToDB}>Lisää</Button>
            </Form>
            
        </>
    )
}
export default AddWorkout;
